con:config.script:
import groovy.sql.Sql;

def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context );
def dataSource = testRunner.testCase.getTestStepByName( "Test Case Properties" );
def host = dataSource.getPropertyValue( "DBHost" );
def port = dataSource.getPropertyValue( "DBPort" );
def user = dataSource.getPropertyValue( "DBUser" );
def pass = dataSource.getPropertyValue( "DBPass" );
def db = dataSource.getPropertyValue( "AuditDB" );
def table = dataSource.getPropertyValue( "AuditTable" );
def userid = dataSource.getPropertyValue( "UserId" );
def request = dataSource.getPropertyValue( "Request_Query" );
def response = dataSource.getPropertyValue( "Response_Query" );

   def sqlConnect = 'jdbc:mysql://' + host + ':' + port + '/' + db;
   log.info sqlConnect
   def sql = Sql.newInstance(sqlConnect, user, pass, "com.mysql.jdbc.Driver");

   //eventid for the request
   def result_request = "select eventId from " + table + " where userid ='" + userid + "' and messageType = 'Entity Inbound';";
   def eventid_request = sql.firstRow(result_request).eventId;
   assert (eventid_request == (request.toInteger()));

   //eventid for the response
   def result_response = "select eventId from " + table + " where userid ='" + userid + "' and messageType = 'Adapter Outbound';";
   def eventid_response = sql.firstRow(result_response).eventId;
   assert (eventid_response == (response.toInteger()));

